export const PRODUCT = 'PRODUCT';
export const PRICE = 'PRICE';

export const productItem = (product) => ({
  type: PRODUCT,
  product,
});

export const productPrice = (price) => ({
  type: PRICE,
  price,
});

export const productDetails = (toogle, product) => ({
  type: PRICE,
  toogle,
  product,
});
